import { useState } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";

function Navbar(props: { isStudentSession: boolean; onLogout: any }) {
    const [expendMenu, setExpendMenu] = useState(false);

    return (
        <div className="navbar-container">
            <div className="logo-container">
                {props.isStudentSession ? <StudentLogo /> : <TeacherLogo />}
                {props.isStudentSession ? <span>Student</span> : <span>Teacher</span>}
            </div>
            <div
                className="menu-button"
                onClick={() => {
                    setExpendMenu(!expendMenu);
                }}
            >
                <MenuLogo />
            </div>
            <div className={expendMenu ? "menu-container" : "menu-container menu-off"}>
                <Link to="/personal" style={{ textDecoration: "none" }}>
                    <MenuItem text="Personal" icon={<UserIcon />} />
                </Link>
                <Link to="/courseSelection" style={{ textDecoration: "none" }}>
                    <MenuItem text="Courses" icon={<CourseLogo />} />
                </Link>
                {props.isStudentSession && (
                    <Link to="/grades" style={{ textDecoration: "none" }}>
                        <MenuItem text="Grades" icon={<GradeIcon />} />
                    </Link>
                )}
                <Link to="/" className="navbar-logout-button" onClick={props.onLogout}>
                    <span>Sign out</span>
                </Link>
            </div>
        </div>
    );
}

function MenuItem(props: { icon: any; text: any }) {
    return (
        <div className="menu-item">
            <div> {props.icon} </div>
            {props.text}
        </div>
    );
}

